class EapiParams {
  static final String splitRegex = "-36cd479b6b5-";

  final String path;
  final String json;
  final String hash;

  EapiParams(this.path, this.json)
    : hash = EapiCrypto.md5String("nobody${path}use${json}md5forencrypt");

