  static String dataDecrypt(String encryptedData) {
    final message = utf8.encoder.convert(
      AesCrypto.decrypt(
        Uint8List.fromList(encryptedData.base16decode()),
        utf8.encode(key),
        mode: AesMode.ecb,
      ),
    );
